import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Gym Membership',
      amount: 13.99,
      date: new Date(2020, 7, 14),
    },
    {
      id: 'e2',
      title: 'Monitor',
      amount: 799.49,
      date: new Date(2021, 2, 12)
    },
    {
      id: 'e3',
      title: 'Monitor Arm',
      amount: 35,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'Wilson EVO NXT',
      amount: 79.99,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <>
      <h2>Expense Tracker</h2>
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </>
  );
}

export default App;
